INSERT INTO `messages` VALUES (28, 1, '来点这种风格的地狱笑话', ' ', '2024-11-24 17:33:27', '地狱笑话');
INSERT INTO `messages` VALUES (29, 3, '重生之我在山科吃什么！', '1⃣北门宋家族亭🏠这应该是北门唯一一家日料店，装饰的真的很不错，里面的菜品也很多，味道很正宗。而且拿到菜单的时候我是震惊的，因为真的很厚一本！有套餐也有单点的菜，均价大概20-30不等，座位有限，最好提早去哦\r\n2⃣C餐的轻食店🏠点的外卖，可送到宿舍楼下。可以自己选酱汁，我选的油醋汁，确实有些酸哈哈，不过整体量很大，女生一份吃不完，里面的膳食纤维很足，是很优秀的减脂餐。不过虽然送过来的时候套了保温袋，但米饭也有点凉。可能是因为外卖的菜和米饭混在一起，所以米饭比较湿软，我比较喜欢吃那种干爽的。\r\n3⃣A餐三楼新疆炒米粉🏠酱汁比较浓郁，而且每天卖的都比较火爆，我有一次晚上去买结果卖没了，买了他家的苕粉。可以选宽的或者细的，我点的宽的苕粉，我觉得味道不错，喜欢吃宽粉的一定会喜欢！而且他家买米线和苕粉还送孜然小饼，那个小饼真的人见人夸，炸的酥脆程度和油润程度刚刚好，搭配着米线吃真的一绝\r\n4⃣A餐3楼汉堡炸鸡店🏠之前朋友点过他家的小食拼盘，我一直没去过，因为人真的太多啦！我晚上去已经到200多号了！我点了一份无骨炸鸡+年糕的，真的好吃！炸鸡粉可以双拼，不用纠结，炸鸡鲜嫩多汁，年糕也很软糯！一定要去尝试一下\r\n5⃣A餐2楼麻辣香锅🏠他家麻辣香锅我觉得比较便宜，之前点了几次都12块左右，还送米饭，但是去晚了米饭就比较凉。唯一的缺点就是会比较油，吃到最后都是辣椒油，不爱吃油腻的慎点哈\r\n6⃣A餐1楼杂粮煎饼🏠前不久刚开的，买的人比较多，我觉得味道中规中矩吧，生菜放的没有北门和南门的多，不过味道也还可以\r\n7⃣A餐2楼羊杂面窗口🏠点了酸豆角拌面和鸡蛋酱面。酸豆角拌面是我同学给我推荐的，确实很好吃，和火鸡拌面一样用的麻酱底，鸡蛋酱面吃起来更像炸酱面，用的不是麻酱底，会有些咸，味道也比较不错。点了一个卤炸蛋，会有点油，但是很好吃。\r\n#学校食堂 #外卖 #小吃 #我的美食日记 #美食\r\n@薯队长 @吃货薯 @日常薯', '2024-11-24 17:45:26', '美食');
INSERT INTO `messages` VALUES (30, 1, '11月预定小车，这次又能当月收到多少台？', '上次10/1小结了一下预定🚗情况，结果除了Poprace的R32 Calsonic收到之外，其他全部一台都没有……\r\n	\r\n吸取经验，这个月把大部分的拓意预定都退掉了，又重新再入手了一批。  保留了还是必入的情怀五代雅阁、必须要继续等的TLV，这次新预定了4台，其中三菱重卡纠结了很久还是订了，担心上市后价格会飙升\r\n￼  \r\n【GCD】三菱FUSO重卡运输车LBWK闪电涂装 【Mortal】宝马3系E36 Touring Alpina 阿尔宾娜金属蓝 【Motor Helix】本田思域Civic Type R EK9 Spoon 日光黄 【DCT/Shadow】本田雅阁七代半 黑色 【拓意】本田雅阁五代 墨绿色 【TLV】斯巴鲁Subaru Impreza WRX STi 蓝色 2003\r\n	\r\n#钣金小镇 #汽车模型 #64比例小车 #LBWK #合金车模 #拓意 #GCD #Mo', '2024-11-24 17:46:13', '汽车');
INSERT INTO `messages` VALUES (31, 1, '除了涩涩，想听听吧友们正经一点的恋爱故事', '最近加拿大下大雪，晚上走在灯光昏暗的路上氛围很浪漫，突然就很想谈恋爱，但我没谈过连梦都不会梦大家恋爱时候有没有那种甜甜的细节拿出来讲讲，让我磕一口就行\r\n（放一张图大家感受一下）', '2024-11-24 17:51:19', '娱乐');
